<template>
  <div>
    <h2>제 마음대로 할 수 있는것입니다.</h2>
    <h2>{{ staticProps }}</h2>
    <h2>{{ myProps }}</h2>
    <img
      src="data:image/jpeg;base64,"
      alt=""
    />
    <br />
    <button @click="meowToHost">냐아아아아아아아아아아옹</button>
    <br />
    <input type="text" v-model="inputData" @keyup.enter="inputToHost" />
  </div>
</template>

<script>
export default {
  name: "MyChild",
  props: {
    staticProps: String,
    myProps: String,
  },
  data: function () {
    return {
      inputData: null,
    };
  },
  methods: {
    meowToHost: function () {
      this.$emit("meow-to-host", "밥줘!!!!");
    },
    inputToHost: function () {
      this.$emit("input-to-host", this.inputData);
    },
  },
};
</script>

